import React, { useEffect, useState } from "react";

const Navbar = () => {
  const [data, setdata] = useState([]);
  useEffect(() => {
    const response = fetch(
      `https://api.themoviedb.org/3/trending/all/week?api_key=c08925b0a10a9ed2a65bf9f938d20719&language=en-US`
    )
      .then((response) => response.json())
      .then((data1) => {
        console.log(data1.results);
        //lưu dữ liệu data
        setdata(data1.results);
      });
    // const data = response.json();

    // console.log(data);
  }, []);
  return (
    <div>
      {data?.map((item) => {
        return (
          <span>
            <img
              src={`https://image.tmdb.org/t/p/original${item[0].backdrop_path}`}
              width="100%"
              height="400px"
            />
          </span>
        );
      })}
    </div>
  );
};

export default Navbar;
